volatile unsigned char OUT[4];

inline static void add(number a, number b)
{
    unsigned char lowByte = a[0];
    unsigned char midByte = a[1];
    a[0] += b[0];
    if (a[0] < lowByte) // carry
        a[1]++;
    a[1] += b[1];
    if (a[1] < midByte) // carry
        a[2]++;
    a[2] += b[2];
}

inline static void add_(number a, volatile unsigned char b)
{
    unsigned char lowByte = a[0];
    a[0] += b;
    if (a[0] < lowByte) // carry
        a[1]++;
}

inline static void zero(number a)
{
    a[0] = 0;
    a[1] = 0;
    a[2] = 0;
}

inline static void mul(volatile unsigned char a, volatile unsigned char b, number dest)
{
    for (int i = 0; i < b; ++i)
    {
        add_(dest, a);
    }
}

inline static int toBigInt(number a)
{
    return a[0] + (a[1] << 8) + (a[2] << 16);
}

MAKE_NUM(result, 0);

inline static int index2d(unsigned char row, unsigned char col)
{
    zero(result);
    mul(row, DIM, result);
    add_(result, col);
    return toBigInt(result);
}



int main()
{
    MAKE_NUM(temp, 0);
    for (int row = 0; row < DIM; ++row)
    {
        for (int col = 0; col < DIM; ++col)
        {
            MAKE_NUM(cell, 0);
            for (int i = 0; i < DIM; ++i)
            {
                unsigned char a = data[index2d(row, i)];
                unsigned char b = data[index2d(i, col)];
                zero(temp);
                mul(a, b, temp);
                add(cell, temp);
            }
            OUT[0] = cell[0];
            OUT[1] = cell[1];
            OUT[2] = cell[2];
        }
    }

    return 0;
}
